import React from 'react' ;

const playerClick = (position) => {
    alert(position)
}

function PlayButton({position})
{
    let i = 0
    const playerClick = (position) => {
        alert(position)
        i = i+1
    }

    return(
        <button className="play-btn" onClick={() => playerClick(position)} props={i}> </button>
    )
}

export default PlayButton ;
